MathJax.Localization.addTranslation("pt","FontWarnings",{version:"2.7.9",isLoaded:!0,strings:{webFont:"O MathJax est\xE1 a utilizar fontes baseadas em web para exibir as f\xF3rmulas matem\xE1ticas desta p\xE1gina. A sua descarga leva algum tempo, ent\xE3o a p\xE1gina seria renderizada mais rapidamente se instalasse as fontes para matem\xE1tica diretamente no diret\xF3rio de fontes do seu sistema.",imageFonts:"O MathJax est\xE1 a utilizar fontes feitas com imagens em vez de fontes locais ou baseadas em web. Isso torna a renderiza\xE7\xE3o mais lenta do que o de costume, e as f\xF3rmulas matem\xE1ticas poder\xE3o n\xE3o ser impressas com a maior resolu\xE7\xE3o dispon\xEDvel na sua impressora.",noFonts:"O MathJax n\xE3o foi capaz de localizar uma fonte para utilizar ao renderizar as f\xF3rmulas matem\xE1ticas, e n\xE3o est\xE3o dispon\xEDveis fontes feitas com imagens, ent\xE3o ser\xE3o utilizados caracteres Unicode gen\xE9ricos com a esperan\xE7a de que o seu navegador seja capaz de exibi-los. Alguns caracteres podem n\xE3o aparecer como deveriam, ou simplesmente desaparecer.",webFonts:"A maioria dos navegadores modernos permite que as fontes sejam descarregadas a partir da web. Atualizar para uma vers\xE3o mais recente do seu navegador (ou mudar de navegador) poderia melhorar a qualidade das f\xF3rmulas matem\xE1ticas desta p\xE1gina.",fonts:"O MathJax pode usar tanto [fontes STIX](%1) ou as [fontes MathJax TeX](%2). Descarregue e instale estas fontes para melhorar a sua experi\xEAncia com o MathJax.",STIXPage:"Esta p\xE1gina foi projetada para utilizar [fontes STIX](%1). Descarregue e instale estas fontes para melhorar a sua experi\xEAncia com o MathJax.",TeXPage:"Esta p\xE1gina foi projetada para utilizar [fontes MathJax TeX](%1). Descarregue e instale estas fontes para melhorar a sua experi\xEAncia com o MathJax."}}),MathJax.Ajax.loadComplete("[MathJax]/localization/pt/FontWarnings.js");
